&lt;h1 id=&#34;故事的开始&#34;&gt;&lt;a href=&#34;#故事的开始&#34; class=&#34;headerlink&#34; title=&#34;故事的开始&#34;&gt;&lt;/a&gt;故事的开始&lt;/h1&gt;&lt;ul&gt;
&lt;li&gt;芜湖让我想想，我对你第一次心中有了触动，就是那天早上嗷&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;一个不普通的早八，一个让我心绪起伏的早八。我记得很清楚嗷，那天周五我不经意说起没吃早餐，然后你呢就一直在关心我，还想着给我送早餐呐。我当时心里真的好感动，第一次有人这么关心我，真的那天我开心了好久。&lt;/p&gt;
