&lt;h1 id=&#34;群聊的升温&#34;&gt;&lt;a href=&#34;#群聊的升温&#34; class=&#34;headerlink&#34; title=&#34;群聊的升温&#34;&gt;&lt;/a&gt;群聊的升温&lt;/h1&gt;&lt;ul&gt;
&lt;li&gt;芜湖想和你聊天，又不敢私聊，只能再群里了解你啦&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;后来，我们一直在群里聊了很多很多，渐渐的，我发现我似乎对你产生了一些不一样的感觉，感觉就很喜欢和你聊天，每次都期待着你能在群里提到我，每次呢见到你都会很开心。但是呢我不知道这到底是不是喜欢，所以我索性吧就这样先维持下去吧，慢慢发展xixi，你有没有发现之后，你偷拍我的时候我都不躲力xixi，因为我想留在你手机里鸭，虽然你每次都把我拍的老丑了。&lt;br&gt;芜湖收藏了一些咱们在群里聊天时的一些记录xixi&lt;/p&gt;
